import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import AddMyList from "./addMyList";
import ShowMyList from "./showMyList";

var myclass = document.querySelector("#myclass");
ReactDOM.render(
    <AddMyList />,
    <ShowMyList />,
    myclass
);
